import { Link } from "react-router-dom";
import s from "./style.module.css";

const MENU = [
  {
    name: "Teams",
    img: "./img/group_person_rounded.svg",
    active: true,
    to: "/",
  },
  {
    name: "Players",
    img: "./img/person_rounded.svg",
    active: false,
    to: "/",
  },
];
const Sidebar: React.FC = () => {
  return (
    <aside className={s.sidebar}>
      <nav>
        <ul>
          {MENU &&
            MENU.map((item) => (
              <li>
                <Link to={item.to}>
                  <img src={item.img} alt={item.name} />
                  <span>{item.name}</span>
                </Link>
              </li>
            ))}
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
